import React from 'react';
import logo from './logo.svg';
import './App.css';
import Details from './painting-extra-details/painting-extra-details'

function App() {
	return (
		<div className="App">
			<Header />
			<Cars />
			<Footer />
		</div>
	);
}

function Header() {
	return (
		<header><h2>Header</h2></header>
	);
}

function Footer() {
	return (
		<footer>Footer</footer>
		);
}

function Cars() {
	return Details.Car();
}


export default App;
